import React from "react";
import Swiper from "react-id-swiper";
import "swiper/css/swiper.css";

import MovieCard from "../MovieCard";

const Carousel = () => {
  const params = {
    slidesPerView: 3,
    spaceBetween: 30,
    pagination: {
      el: ".swiper-pagination",
      clickable: true,
    },
  };
  return (
    <Swiper {...params}>
      <MovieCard />
    </Swiper>
  );
};
export default Carousel;
